CREATE TABLE marca (
  id_marca int(2) NOT NULL primary key auto_increment,
nombre_marca varchar(20) NOT NULL,
  id_estado int(2)

);
ALTER TABLE marca ADD FOREIGN KEY (id_estado) REFERENCES estado(id_estado);

INSERT INTO marca ( nombre_marca, id_estado) VALUES
( 'NIKE', 0),
('Adidas', 0)
;
create table producto(
  id_producto int(30) NOT NULL primary key auto_increment,
  nom_producto varchar(30) NOT NULL,
  talla varchar (3) not null,
  observaciones varchar(30) NOT NULL,
  cantidad float (50) NOT NULL,
  fecha_embarque varchar (20) NOT NULL,
  imagen longblob NOT NULL,
  id_marca int(2) NOT NULL,
  id_estado int(2) NOT NULL
);
ALTER TABLE producto ADD FOREIGN KEY (id_estado) REFERENCES estado(id_estado);

ALTER TABLE producto ADD FOREIGN KEY (id_marca) REFERENCES marca(id_marca);

